import './App.css';
import Clock from './components/Tick';
import Toggle from './components/Toggle';
import LoginControl from './components/auth/AuthPage';
import Calculator from "./components/Calculator/Calculator";
function App() {
  return (
    <div className="App">
        <Clock />;
        <Toggle />;
        <LoginControl />;
        <Calculator />;
    </div>
  );
}



export default App;
